import React from 'react';

const result = (props) => {
    return (
        <div className="result">
            <p className="result-name" onClick={props.click}>{props.name}</p>
            <p className="result-description" onClick={props.click}>{props.description}</p>
            <a className="result-btn" onClick={props.click}>Select</a>
        </div>
    )
}

export default result;
